import { useEffect, useMemo, useState } from "react";
import { Link } from "react-router-dom";
import brandService from "../../services/brand.service";
import FilterComponent from "../../components/Filter/FilterComponent";
import DataTable from "react-data-table-component";

export default function BrandList() {
    const userRole = localStorage.getItem("role");

    // Const
    const columns = [
        {
            name: 'Id',
            selector: row => row.brandId,
            sortable: true,
        },
        {
            name: 'Name',
            selector: row => row.brandName,
            sortable: true,
        },
        {
            cell: (row) => userRole && userRole === "ROLE_STAFF" && <Link className="btn btn-warning" to={"/brands/edit/" + row.brandId}>Edit</Link>,
            ignoreRowClick: true,
            allowOverflow: true,
            button: true,
        },
        {
            cell: (row) => userRole && userRole === "ROLE_STAFF" && <button className="btn btn-danger" onClick={() => deleteRecord(row.brandId)} id={row.brandId}>Delete</button>,
            ignoreRowClick: true,
            allowOverflow: true,
            button: true,
        },
    ];

    // States
    const [data, setData] = useState([]);
    const [filterText, setFilterText] = useState('');
    const [filteredData, setFilteredData] = useState([]);

    useEffect(() => {
        brandService.getAll().then(response => {
            console.log(response.data);
            setData(response.data);
            setFilteredData(response.data);
        });
    }, []);

    useEffect(() => {
        setFilteredData(data.filter(item => item.brandName.toLowerCase().includes(filterText.toLowerCase())));
    }, [filterText]);

    const searchMemo = useMemo(() => {
        const handleClear = () => {
            if (filterText) {
                setFilterText('');
            }
        };

        return (
            <FilterComponent onFilter={e => setFilterText(e.target.value)} onClear={handleClear} filterText={filterText} />
        );
    }, [filterText]);

    function deleteRecord(id) {
        brandService.delete(id).then(response => {
            const newData = data.filter(x => x.brandId !== id);
            const newFilteredData = filteredData.filter(x => x.brandId !== id);
            setData(newData);
            setFilteredData(newFilteredData);
        }).catch(err => {
            console.log(err);
        });
    }

    return (
        <>
            {userRole && userRole === "ROLE_STAFF" && (
                <div className="mb-3">
                    <Link to="/brands/add" className="btn btn-success">New Brand</Link>
                </div>
            )}

            <div className="col-md-12">
                <div className="image-container d-flex justify-content-between align-items-center mb-3">
                    <img src='/brendovi.png' alt='login' width={500} height={100} style={{ marginRight: '10px' }} />
                    <img src='/brendovi2.png' alt='login' width={500} height={100} style={{ marginLeft: '10px' }} />
                </div>
                <DataTable
                    title="Brands List"
                    columns={columns}
                    data={filteredData}
                    pagination
                    subHeader
                    subHeaderComponent={searchMemo}
                    selectableRows
                    persistTableHead
                    className="brand-list-table"
                />
            </div>
        </>
    );
}
